---
{{ $azurestack := .global.workflow.input.azurestack }}{{ $intersight := .global.workflow.input.intersight }}{{ $protocols := .global.workflow.input.protocols }}{{ $proxy := .global.workflow.input.proxy }}{{ $windows_install := .global.workflow.input.windows_install }}protocols:
{{ if index $protocols "dhcp_servers" }}  dhcp_servers:
{{ range $i, $dhcps := $protocols.dhcp_servers }}    - {{ $dhcps}}
{{ end }}{{ else }}  dhcp_servers: []
{{ end }}{{ if index $protocols "dns_domains" }}  dns_domains:
{{ range $i, $dnsdomains := $protocols.dns_domains }}    - {{ $dnsdomains}}
{{ end }}{{ else }}  dns_domains: []
{{ end }}{{ if index $protocols "dns_servers" }}  dns_servers:
{{ range $i, $dnsservers := $protocols.dns_servers }}    - {{ $dnsservers}}
{{ end }}{{ else }}  dns_servers: []
{{ end }}  timezone: {{ if index $protocols "timezone" }}{{ $protocols.timezone }}{{ else }}Etc/GMT{{ end }}
{{ if index $protocols "ntp_servers" }}  ntp_servers:
{{ range $i, $ntpservers := $protocols.ntp_servers }}    - {{ $ntpservers}}
{{ end }}{{ else }}  ntp_servers: []
{{ end }}proxy:
  url: {{ if index $proxy "url" }}{{ $proxy.url }}{{ else }}''{{ end }}
  username: {{ if index $proxy "username" }}{{ $proxy.username }}{{ else }}''{{ end }}
windows_install:
  language_pack: {{ if index $windows_install "language_pack" }}{{ $windows_install.language_pack}}{{ else }}English - United States{{ end }}
  layered_driver: {{ if index $windows_install "layered_driver" }}{{ $windows_install.layered_driver }}{{ else }}0{{ end }}
azurestack:
  - active_directory:
      domain: {{ if index $azurestack.active_directory "domain" }}{{ $azurestack.active_directory.domain }}{{ else }}example.com{{ end }}
      administrator: {{ if index $azurestack.active_directory "administrator" }}{{ $azurestack.active_directory.administrator }}{{ else }}administrator@example.com{{ end }}
    azurestack_admin: {{ if index $azurestack "azurestack_admin" }}{{ $azurestack.azurestack_admin}}{{ else }}hciadmin@example.com{{ end }}
    azurestack_ou: {{ if index $azurestack "azurestack_ou" }}{{ $azurestack.azurestack_ou }}{{ else }}AzureStack{{ end }}
    azurestack_prefix: {{ if index $azurestack "azurestack_prefix" }}{{ $azurestack.azurestack_prefix }}{{ else }}AzS{{ end }}
    clusters:
{{ range $i, $cluster := $azurestack.clusters }}      - name: {{ if index $cluster "name" }}{{ $cluster.name }}{{ else }}CLUSTER01{{ end }}
        members:
{{ range $e, $member := $cluster.members }}          - cimc: {{ if index $member "cimc" }}{{ $member.cimc }}{{ else }}198.18.1.1{{ end  }}
            hostname: {{ if index $member "hostname" }}{{ $member.hostname }}{{ end }}
{{ end }}        subscription: {{ if index $cluster "azure_subscription_id" }}{{ $cluster.azure_subscription_id }}{{ else }}53614803-d327-4397-bf55-8dedcc24be0d{{ end }}
{{ end }}intersight:
  - organization: {{ if index $intersight "organization" }}{{ $intersight.organization }}{{ end }}
    cimc_default: {{ if index $intersight "cimc_default" }}{{ $intersight.cimc_default }}{{ else }}false{{ end }}
    firmware: {{ if index $intersight "firmware" }}{{ $intersight.firmware }}{{ else }}4.2(3e){{ end }}
    policies:
      local_user: {{ if index $intersight.policies "local_user" }}{{ $intersight.policies.local_user }}{{ end }}
      prefix: {{ if index $intersight.policies "prefix" }}{{ $intersight.policies.prefix }}{{ end }}
      snmp:
        contact: {{ if index $intersight.policies.snmp "contact" }}{{ $intersight.policies.snmp.contact }}{{ else }}''{{ end }}
        location: {{ if index $intersight.policies.snmp "location" }}{{ $intersight.policies.snmp.location }}{{ else }}''{{ end }}
        username: {{ if index $intersight.policies.snmp "username" }}{{ $intersight.policies.snmp.username }}{{ else }}''{{ end }}
{{ if index $intersight.policies.snmp "snmp_servers" }}        servers:
{{ range $i, $snmp_servers := $intersight.policies.snmp.snmp_servers }}          - {{ $snmp_servers }}
{{ end }}{{ else }}        servers: []
{{ end }}      syslog:
{{ if index $intersight.policies "syslog_servers" }}        servers:
{{ range $i, $syslog_servers := $intersight.policies.syslog_servers }}          - {{ $syslog_servers}}
{{ end }}{{ else }}        servers: []
{{ end }}nxos_configure: {{ if index .global.workflow.input "config_nxos" }}{{ .global.workflow.input.config_nxos }}{{ else }}false{{ end }}
{{ if eq .global.workflow.input.config_nxos true}}nxos:
  - username: {{ if index .global.workflow.input.nxos "username" }}{{ .global.workflow.input.nxos.username }}{{ end }}
{{ if index .global.workflow.input.nxos "switches" }}    switches:
{{ range $i, $switch := .global.workflow.input.nxos.switches }}      - hostname: {{ if index $switch "hostname" }}{{ $switch.hostname }}{{ end }}
        breakout_speed: {{ if index $switch "breakout_speed" }}{{ $switch.breakout_speed }}{{ else }}25G{{ end }}
        switch_type: {{ if index $switch "switch_type" }}{{ $switch.switch_type }}{{ else }}network{{ end }}
{{ if index $switch "configure_vpc" }}        vpc_config:
          domain_id: {{ if index $switch "vpc_domain_id" }}{{ $switch.vpc_domain_id }}{{ end }}
          keepalive_ip: {{ if index $switch "vpc_keepalive_ip" }}{{ $switch.vpc_keepalive_ip }}{{ end }}
{{ if index $switch "vpc_keepalive_ports" }}          keepalive_ports:
{{ range $i, $vpc_keepalive_ports := $switch.vpc_keepalive_ports }}            - {{ $vpc_keepalive_ports}}
{{ end }}{{ else }}          keepalive_ports: []
{{ end }}{{ if index $switch "vpc_peer_ports" }}          peer_ports:
{{ range $i, $vpc_peer_ports := $switch.vpc_peer_ports }}            - {{ $vpc_peer_ports }}
{{ end }}{{ else }}          peer_ports: []
{{ end }}{{ end }}{{ end }}{{ else }}    switches: []
{{ end }}{{ else }}nxos: []
{{ end }}{{ if index .global.workflow.input "vlans" }}vlans:
{{ range $i, $vlan := .global.workflow.input.vlans }}  - vlan_type: {{ if index $vlan "vlan_type" }}{{ $vlan.vlan_type }}{{ else }}vm{{ end }}
    vlan_id: {{ if index $vlan "vlan_id" }}{{ $vlan.vlan_id }}{{ end }}
    name: {{ if index $vlan "name" }}{{ $vlan.name }}{{ end }}
    network: {{ if index $vlan "network" }}{{ $vlan.network }}{{ end }}
    configure_l2: {{ if index $vlan "configure_l2" }}{{ $vlan.configure_l2 }}{{ else }}false{{ end }}
    configure_l3: {{ if index $vlan "configure_l3" }}{{ $vlan.configure_l3 }}{{ else }}false{{ end }}
    switch_type: {{ if index $vlan "switch_type" }}{{ $vlan.switch_type }}{{ end }}
    ranges:
      server: {{ if index $vlan "ranges_server" }}{{ $vlan.ranges_server }}{{ end }}
{{ end }}{{ else }}vlans: []
{{ end }}
